import React from 'react';

function SearchBar() {
  return (
        <div className="container">
            <div className="searchbox">
                <h2>Search User</h2>
                <div className="search">

                    <div className="searchField">
                        <input 
                            type="text" 
                            placeholder="Search User here ..."
                        />    
                    </div>       
                </div>
            </div>
        </div>
  )
}

export default SearchBar;
